import React from 'react';
import Pokemon from './pokemon';

class Pokedex extends React.Component {
  render() {
    return (
      <div>
        {this.props.pokemons.map((pokemon) => <Pokemon key={pokemon.id}/>)}
      </div>
    )
  }
}

export default Pokedex;
